sukuApp.factory("AuthInterceptor",["$q",function(a){return{responseError:function(c){if(c.status==400){var b=angular.element("#auth-modal");b.modal();console.log(c)}return a.reject(c)}}}]).config(["$httpProvider",function(a){a.interceptors.push("AuthInterceptor")}]);sukuApp.factory("ConnInterceptor",["$q",function(a){return{response:function(b){angular.element(".conn-error-alert").removeClass("active");return a.when(b)},responseError:function(b){if(b.status==0){var c=angular.element("#conn-error-alert");c.clone().addClass("active").removeAttr().appendTo("body");console.log(b)}return a.reject(b)}}}]).config(["$httpProvider",function(a){a.interceptors.push("ConnInterceptor")}]);